import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import LoginPage from "./pages/LoginPage"; // LoginPage.js 파일 임포트

const App = () => {
  return (
    <Router>
      <Routes>
        {/* LoginPage를 기본 경로로 설정 */}
        <Route path="/" element={<LoginPage />} />


      </Routes>
    </Router>
  );
};

export default App;
